                      <div id="pgc-7249-8-0" class="panel-grid-cell">
                        <div id="panel-7249-8-0-0" class="so-panel widget widget_sow-editor panel-first-child panel-last-child" data-index="18">
                          <div class="so-widget-sow-editor so-widget-sow-editor-base">
                            <div class="siteorigin-widget-tinymce textwidget">
                              <p>Строительство каркасных домов и домов по технологии фахверк – достаточно сложный и ответственный процесс, требующий исключительно профессионального подхода. Далеко не всегда удается самостоятельно достичь желаемого результата – построить уютный и добротный каркасный дом.</p>
                              <h1>Строительство каркасных домов и домов фахверк</h1>
                              <p>Наша компания предлагает помощь в возведении домов. В комплект наших услуг могут быть включены следующие этапы:</p>
                              <ol>
                                <li>Разработка проектной документации или предложение уже готовых вариантов, которые положительно зарекомендовали себя с практической точки зрения. На данный момент у нас вы найдете более 1600 проектов каркасных домов, 17 проектов домов фахверк, 16 проектов энергоэффективных домов</li>
                                <li>Выбор и возведение фундамента в зависимости от участка и грунта. Все геодезические изыскания осуществляются опытными инженерами.</li>
                                <li>Непосредственное строительство каркасных домов и домов фахверк в строго установленные сроки и по заранее оговоренной цене.</li>
                                <li>Подвод коммуникаций и организация приусадебной территории, вплоть до возведения забора.</li>
                                <li>Сдача объекта.</li>
                              </ol>
                              <h2>Мы – профессионалы</h2>
                              <p>Наша компания занимается строительством каркасных домов и домов фахверк в Чебоксарах и Чувашской Республике, а также в близлежащих регионах. Главное достоинство данных технологий строительства – быстрый монтаж и высокая экологичность, что является определяющими факторами при выборе в нашем современном обществе. Строительство каркасных и фахверковых домов в полной мере адаптировано под наши отечественные климатические условия.</p>
                              <p>Предлагаем каркасные и фахверковые дома под ключ : от проектирования до прокладки коммуникаций в фундаменте, сборки каркаса и кровли, до наружней и внутренней отделки. Поэтому, обратившись в нашу компанию, вы избавите себя от траты времени на поиски узкопрофильных специалистов для проведения каких-либо работ.</p>
                              <p>Среди достоинств нашей компании стоит выделить:<br />• Использование материалов только самого высокого качества в соответствии с ГОСТом.<br />• Тщательная обработка каркаса огнезащитным раствором, сертифицированным МЧС России.<br />• Проведение всех проектных и монтажных работ в соответствии с «СП 31-105-2002 Проектирование и строительство домов с деревянным каркасом».<br />• Низкие цены. Мы работаем напрямую с поставщиками, поэтому можем предложить наиболее привлекательные цены как на строительные материалы, так и на готовые домокомплекты.<br />• Сопровождение клиента после сдачи объекта в эксплуатацию.</p>
                              <p>Мы дорожим каждым клиентом, поэтому всегда готовы предложить индивидуальные условия сотрудничества. Для того чтобы начать с нами работу, свяжитесь с менеджерами, которые более подробно расскажут об особенностях данных технологий и ответят на все ваши вопросы.</p>
                              <p>Мы гарантируем качество работ при строительстве каркасных домов и домов фахверк – ваша «домашняя крепость» будет уютной и долговечной.</p>
